import React, { useState } from 'react';
import {Calendar, CalendarList, Agenda} from 'react-native-calendars';
import axios from 'axios';
import { Alert, StyleSheet, Text, Pressable, View } from "react-native";
import Modal from "react-native-modal";
import NavBar from '../components/NavBar';
export default function page1() {

      return (
        <div>
           <h3>Overview</h3>
           <h4>Why I created this</h4>
           <p4>I developed this healthy living strategy when I realized that living like a 23 year-old while I was 33 years-old was no longer going to work. I had had many failures trying to maintain a healthy lifestyle, and took almost a decade of failing to devise this method.</p4>



            </div>
          )
      }
